import React from 'react';
import './Header.css'

const Header = () => {
    return (
        <header className='header'>
            <img src='https://www.logofound.com/wp-content/uploads/2017/06/abstract-logo-template-11-02.jpg'></img>
        </header>
    )

}
export default Header
